import "./Character.css";
import characters from "../db/Character/Character";


function Character({searchField, searchChange}){
    const data = characters;
    const dataItem = data.map((list) => (
        <li>
            <br/>{list.char_id} <br/>
            {list.name}<br/>
            {list.birthday}<br/>
            {list.occupation}<br/>
            {list.img}<br/>
            {list.status}<br/>
            {list.appearance}<br/>
            {list.nickname}<br/>
            {list.portrayed}<br/>
            {list.better_call_saul_appearance}
         </li>
    ));
    return (
        <div>
            <div>
              <h2>Characters Record</h2>
          </div>
          <div className="input">
        <input type="search" placeholder="Input what to find" onChange={searchChange} />
    </div>
            <p>{dataItem}{}</p>
        </div>
    );
}

export default Character;
